import { Status } from "../models/Status";

interface StatusListProps {
    statuses: Status[];
}

const StatusList = (props: StatusListProps): JSX.Element => {
    const { statuses } = props;

    console.log(statuses);

    return (
        <>
            {statuses.map((status) => {
                <div>
                    <b>{status.username}</b>
                    <br/>
                    {status.text}
                </div>
            })}
        </>
    )
}

export default StatusList;
